local version = 0.982

if myHero.charName ~= "Jinx" then return end

function Print(message) print("<font color=\"#FF0066\"><b>Jinx, Bombs and Bullets:</font> </b><font color=\"#FFFFFF\">" .. message) end
require "VPrediction"
vPred = VPrediction()
function CheckOrbwalk()
	 if _G.Reborn_Loaded and not _G.Reborn_Initialised then
        DelayAction(CheckOrbwalk, 1)
    elseif _G.Reborn_Initialised then
        sacused = true
		JinxMenu.Orbwalking:addParam("info11","SAC Detected", SCRIPT_PARAM_INFO, "")
    elseif _G.MMA_Loaded then
		JinxMenu.Orbwalking:addParam("info11","MMA Detected", SCRIPT_PARAM_INFO, "")
		mmaused = true
	else
		require "SxOrbWalk"
		SxOrb:LoadToMenu(JinxMenu.Orbwalking, false) 
		sxorbused = true
		SxOrb:RegisterAfterAttackCallback(MyAfterAttack)
		DelayAction(function()		
			if SxOrb.Version < 2.44 then
				Print("Your SxOrbWalk library is outdated, please get the latest version!")
			end
		end, 5)
	end
end
DelayAction(CheckOrbwalk, 4)

Print("Version "..version.." loaded")
Print("Warning: This script doesn't auto-update! Follow me on Twitter @TheRalphlol to know when my scripts get updated or when I'm streaming.")

